string::String::push_str.doc:
Appends a given string slice onto the end of this `String`.

# Panics

Panics if the new capacity exceeds `isize::MAX` _bytes_.

# Examples

```
let mut s = String::from("foo");

s.push_str("bar");

assert_eq!("foobar", s);
```

